int sieve_of_eratosthenes(int maxInp) {
    std::map<int, int>::iterator outputIter = output.begin();
    fill(is_prime, is_prime + SQRT_N, 1);
    is_prime[0] = is_prime[1] = false;

    for (size_t num = 2; num < SQRT_N; num+=2) {
        if (is_prime[num]) {
            primes[primesLength]=num;
            primeCount ++;
            if (primeCount == outputIter->first) {
                outputIter->second = num;
                outputIter++;
                if (outputIter == output.end()) return 1;
            }
            
            size_t multiple = num * num;
            while (multiple < SQRT_N) {
                is_prime[multiple] = 0;
                multiple += (num << 1);
            }
            primesLength += 1;
            if (primeCount == 1) {
                num = 1;
            }
        }
    }
    int blockId = 1;
    int low = SQRT_N;

    for (;low < MAX_N; blockId += 1, low += SQRT_N) {
        int high = low + SQRT_N;

        if (outputIter->first > blockPrimesCnt[blockId]) {
            primeCount = blockPrimesCnt[blockId];
            continue;
        }
        // cout << "* " << low << " - " << high << "; " << primeCount << endl;
        fill(is_prime, is_prime + SQRT_N, 1);

        for (size_t pos = 0; pos < primesLength; ++pos) {
            int prime = primes[pos];
            int multiple = ((low-1)/prime + 1) * prime;
            while (multiple < high) {
                is_prime[multiple - low] = 0;
                multiple += prime;
            }
        }

        // Print primes matching inp in the order of input
        for (int i = low+1; i < high; i+=2) {
            int hv = i - low;
            if (is_prime[hv]) {
                primeCount ++;
                if (primeCount == outputIter->first) {
                    outputIter->second = i;
                    outputIter++;
                    if (outputIter == output.end()) return 2;
                }
            }
        }
    }

    return 3;
}

int main() {
    int maxInp = 0;

    for (int i = 0; i < IN_N; ++i) {
        string line;
        getline(cin, line);
        if (line[0] != 'q') {
            inp[i] = stoi(line);
        } else {
            inp[i] = stoi(line.substr(9));
            q = i;
        }
        maxInp = max(maxInp, inp[i]);
        output[inp[i]] = -1;
    }

    // Call the sieve_of_eratosthenes function
    sieve_of_eratosthenes(maxInp);

    for (int i = 0; i < IN_N; ++i) {
        if (i == q) {
            cout << "qq_group:";
        }
        cout << output[inp[i]] << endl;
    }
    return 0;
}
